import React from 'react'
import useHome from '../data/useHome'

import { Link } from 'react-router-dom'

const Home = () => {
    const home = useHome()
    console.log(home);
    return (
        home.map(item => (
            <Link to={item.link} key={item.pageId}>
                    {item.title}
            </Link>
        ))
    )
}

export default Home
